def binarySearchRecursive(lst, key, low, high):
    print("Recursive call: ", low, high)
    if low > high:
        return -1

    mid = (low + high) // 2
    if key == lst[mid]:
        return mid
    elif key < lst[mid]:
        return binarySearchRecursive(lst, key, low, mid - 1)
    else:
        return binarySearchRecursive(lst, key, mid + 1, high)

